import React from "react";

import Home from "../src/Components/Home";
import Templates from "../src/Components/Templates";
import Navbar from "../src/Components/navbar";

function App() {
  return (
    <div>
      <Navbar />
      <Home />
      <Templates />
    </div>
  );
}

export default App;
